- input: "TEXT\x1CC00161810\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in response
    of the Commission's Request for Additional Information dated 03-10-2010 for the
    2009 Year End Report regarding transfers from the Committee for Change, a joint
    fundraising Committee.  Please be advised that all the memo entries from the joint
    fundraising committee were reported in 2009 and the disbursement of $4,445 was
    the final disbursement.  -  In addition, while researching the Commission's request
    it was discovered that the committee inadvertently omitted the December in-kind
    voter file receipt and disbursement from the Democratic National Committee.  This
    amendment discloses those transactions..  Please note that employees of the Committee
    that spent less than 25% of their time on Federal Election Activity were paid
    on the Schedule H4 uniform split; this includes benefits. -  All fundraising activity
    on this Report was for the benefit of the Committee and was not attributable to
    any candidate for federal office.  -   The transfer of the joint fundraising proceeds
    received during this reporting period from the Democratic National Committee State
    Party Victory Fund, State Partnership Program and/or ASDC Dollars for Democrats
    Fundraiser programs represents the committee's share of proceeds for contributions
    received during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee.\n"
